package components.curve.line;

import java.awt.BasicStroke;
import java.awt.Stroke;
import java.beans.PropertyChangeEvent;
import java.beans.PropertyChangeListener;

import components.listenersupport.PropertyListenerSupport;
import components.observableshapes.ObservableLineInterface;
import util.annotations.EditablePropertyNames;
import util.annotations.PropertyNames;
import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;

@StructurePattern(StructurePatternNames.LINE_PATTERN)
@PropertyNames({"x", "y", "width", "height", "stroke"})
@EditablePropertyNames({})
public class CurveLine implements ObservableLineInterface{
	
	private PropertyListenerSupport propertyListenerSupport = new PropertyListenerSupport();
	private int x, y, width, height;
	private Stroke stroke = new BasicStroke(0.5f);

	public CurveLine(int newX, int newY, int newWidth, int newHeight) {
		setX(newX);
		setY(newY);
		setWidth(newWidth);
		setHeight(newHeight);
	}
	
	@Override
	public int getX() {
		return x;
	}

	@Override
	public void setX(int newX) {
		int oldX = x;
		x = newX;
		propertyListenerSupport.notifyAllListeners(
				new PropertyChangeEvent(this, "x", oldX, x));
	}

	@Override
	public int getY() {
		return y;
	}

	@Override
	public void setY(int newY) {
		int oldY = y;
		y = newY;
		propertyListenerSupport.notifyAllListeners(
				new PropertyChangeEvent(this, "y", oldY, y));
	}

	@Override
	public int getWidth() {
		return width;
	}

	@Override
	public void setWidth(int newWidth) {
		int oldWidth = width;
		width = newWidth;
		propertyListenerSupport.notifyAllListeners(
				new PropertyChangeEvent(this, "width", oldWidth, width));
	}

	@Override
	public int getHeight() {
		return height;
	}

	@Override
	public void setHeight(int newHeight) {
		int oldHeight = height;
		height = newHeight;
		propertyListenerSupport.notifyAllListeners(
				new PropertyChangeEvent(this, "height", oldHeight, height));
	}


	@Override
	public Stroke getStroke() {
		return stroke;
	}

	@Override
	public void setStroke(Stroke newStroke) {
		stroke = newStroke;
	}

	@Override
	public void addPropertyChangeListener(PropertyChangeListener aListener) {
		propertyListenerSupport.addElement(aListener);
	}

}

package components.curve.fitting;

import java.util.Arrays;

import components.curve.composedGraph.ComposedGraphInterface;
import components.curve.line.CurveLine;
import components.observableshapes.ObservablePointInterface;
import components.plane.plane.PlaneInterface;

public class Plotter {
	private ComposedGraphInterface graph;
	private AngleTimeFunction function = new AngleTimeFunction();
	private FittingProcessorInterface fitter = new FittingProcessor();
	
	public Plotter(ComposedGraphInterface aGraph) {
		graph = aGraph;
	}
	
	public void plot() {
		double planeX = graph.getPlane().getX();
		double planeY = graph.getPlane().getY();
		
  		double xScale = (graph.getPlane().getXMax() - graph.getPlane().getXMin())  / (PlaneInterface.Y_LENGTH * graph.getPlane().getYTickNumber() / (graph.getPlane().getYTickNumber() + 1));
		double yScale = (graph.getPlane().getYMax() - graph.getPlane().getYMin()) / (PlaneInterface.X_LENGTH * graph.getPlane().getXTickNumber() / (graph.getPlane().getXTickNumber() + 1));
		for (ObservablePointInterface point : graph.getPoints()) {
			fitter.addFittingPoint((point.getX() + point.getRadius() - planeX) * xScale, (planeY - point.getY() - point.getRadius()) * yScale);	
		}
		graph.getFittingLines().clear();
		
		double[] coeff = fitter.process();
		
		System.out.println(Arrays.toString(coeff));
		
		for (double t = 0.2; t < 10; t += 0.2) {
			
			double yValuePrev = function.value(t - 0.2, coeff);
			double yValue = function.value(t, coeff);
			
			int yPlotPrev = (int) (planeY - yValuePrev / yScale - 5.0);
			int xPlotPrev = (int) ((t - 0.2) / xScale + planeX - 5.0);
			int yPlot = (int) (planeY - yValue / yScale - 5.0);
			int xPlot = (int) (t / xScale + planeX - 5.0);
			graph.getFittingLines().add(new CurveLine(xPlotPrev, yPlotPrev, xPlot - xPlotPrev, yPlot - yPlotPrev));
		}
 
		
		
	}
}

